import React from 'react';
import video from "./wallpaper.mp4"


const HomePage = () => {
  return (
    <div>
      <h1 className="hp">Home Page</h1>
      <video autoPlay muted loop id="myVideo"> <source src={video} type="video/mp4"/></video>
    </div>
  );
};

export default HomePage;
